import React from "react";
import "./css/header.css";

function Header() {
  return (
    <div className="header-container">
      <img
        src="https://www.google.com/search?q=illuminati&sca_esv=e96a0e7e0d01906d&sxsrf=ACQVn0-BqI-no_qvrqp4KImB4KnSo9KP8A:1708511022687&tbm=isch&source=iu&ictx=1&vet=1&fir=-2btu6qDqcwUkM%252CVyt7z8MkPgDQwM%252C%252Fm%252F03w79%253BOWayfa1uPIQb8M%252ClL__vlBE4DDadM%252C_%253BtOPK8WJY1drIkM%252CpQfKNq33eBy72M%252C_%253BKncQB7jdci7xgM%252CrYvjZAqUvUH4OM%252C_%253Bn0lsEhaBu7dfbM%252CG-FGmunc6dNcdM%252C_%253BG-jkyhjUyIwueM%252C_3__9muZlHv-aM%252C_%253BrqjMgAFDpgPEaM%252C4bZgAoDPs4Gz-M%252C_&usg=AI4_-kQyPwAxIY19T_gipCFb2HbeJm_EpA&sa=X&ved=2ahUKEwjAiejEm7yEAxVDkVYBHaDwDTsQ_B16BAhCEAE#imgrc=-2btu6qDqcwUkM"
        alt="hinhanh"
      />
      <span className="header-main-name">ILLUMINATI GROUP</span>
      <div className="header-navbar">
        <a href="">Home</a>
        <a href="">About us</a>
        <a href="">Contact us</a>
      </div>
    </div>
  );
}

export default Header;
